import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Appp from './containers/Appp';
import reportWebVitals from './reportWebVitals';
import 'tachyons';


ReactDOM.render(
    <Appp/>
  ,document.getElementById('root')
);

